function CommonsBase_Std__Dotnet_SDK.form_values_windows(slot)
  local precommands = {
    private = {
      "get-asset CommonsBase_Dotnet.SDK.Bundle@10.0.100-rc.2.25502.107 -p dotnet-sdk-10.0.100-rc.2.25502.107-win-x64.zip -d ${SLOT.Release.Windows_x86_64}",
      "get-asset CommonsBase_Dotnet.SDK.Bundle@10.0.100-rc.2.25502.107 -p dotnet-sdk-10.0.100-rc.2.25502.107-win-x86.zip -d ${SLOT.Release.Windows_x86}",
      "get-asset CommonsBase_Dotnet.SDK.Bundle@10.0.100-rc.2.25502.107 -p dotnet-sdk-10.0.100-rc.2.25502.107-win-arm64.zip -d ${SLOT.Release.Windows_arm64}",
    }
  }

  -- concatenate ALL, WIN32_ALL and Windows_XXX lists into `paths` using `table.move (a1, f, e, t [,a2])`
  local paths = {}
  local tbl = CommonsBase_Std__Dotnet_SDK.paths.ALL
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible
  local tbl = CommonsBase_Std__Dotnet_SDK.paths.WIN32_ALL
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible
  if slot == "Release.Windows_x86_64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Windows_x86_64
  elseif slot == "Release.Windows_x86" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Windows_x86
  elseif slot == "Release.Windows_arm64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Windows_arm64
  else
    error("Unsupported Windows slot: " .. slot)
  end
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible

  local outputs = {
    assets = {
      {
        slots = { slot },
        paths = paths
      }
    }
  }
  return precommands, outputs
end

function CommonsBase_Std__Dotnet_SDK.form_values_unix(slot)
  local arch = ""
  if slot == "Release.Darwin_arm64" then
    arch = "osx-arm64"
  elseif slot == "Release.Darwin_x86_64" then
    arch = "osx-x64"
  elseif slot == "Release.Linux_arm64" then
    arch = "linux-arm64"
  elseif slot == "Release.Linux_x86_64" then
    arch = "linux-x64"
  elseif slot == "Release.Linux_arm64m" then
    arch = "linux-musl-arm64"
  elseif slot == "Release.Linux_x86_64m" then
    arch = "linux-musl-x64"
  else
    error("Unsupported Unix slot: " .. slot)
  end

  -- concatenate ALL, UNIX_ALL, <OS>_ALL and <Unix>_XXX lists using `table.move (a1, f, e, t [,a2])`
  -- into `paths`
  local paths = {}
  local tbl = CommonsBase_Std__Dotnet_SDK.paths.ALL
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible
  tbl = CommonsBase_Std__Dotnet_SDK.paths.UNIX_ALL
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible
  if slot == "Release.Darwin_arm64" or slot == "Release.Darwin_x86_64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Darwin_ALL
  else
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Linux_ALL
  end
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible
  if slot == "Release.Darwin_arm64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Darwin_arm64
  elseif slot == "Release.Darwin_x86_64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Darwin_x86_64
  elseif slot == "Release.Linux_arm64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Linux_arm64
  elseif slot == "Release.Linux_x86_64" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Linux_x86_64
  elseif slot == "Release.Linux_arm64m" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Linux_arm64m
  elseif slot == "Release.Linux_x86_64m" then
    tbl = CommonsBase_Std__Dotnet_SDK.paths.Linux_x86_64m
  else
    error("Unsupported Unix slot: " .. slot)
  end
  table.move(tbl, 1, table.getn(tbl), table.getn(paths) + 1, paths) ---@diagnostic disable-line: deprecated, access-invisible

  -- make the `pathsarr` variant for the W3C HTML JSON forms expression `paths[]=path1 paths[]=path2 ...`
  local pathsarr = {}
  local key, value = 1, paths[1]
  while value do
    pathsarr[key] = "paths[]=" .. value
    key, value = key + 1, paths[key + 1]
  end
  local paths_str        = table.concat(pathsarr, " ")

  local getasset_tarfile =
      string.format(
        "$(get-asset CommonsBase_Dotnet.SDK.Bundle@10.0.100-rc.2.25502.107 -p dotnet-sdk-10.0.100-rc.2.25502.107-%s.tar.gz -f :file)",
        arch)
  local postobject       =
      string.format(
        "post-object CommonsBase_Std.Extract.Untar@0.1.0 -d ${SLOT.%s} modver=CommonsBase_Dotnet.SDK.Unix.%s@10.0.100-rc.2.25502.107 tarfile=%s %s",
        slot,
        slot,
        getasset_tarfile,
        paths_str)
  local precommands      = {
    private = {
      postobject
    }
  }
  local outputs          = {
    assets = {
      {
        slots = { slot },
        paths = paths
      }
    }
  }
  return precommands, outputs
end

